1980. Een jonge Californische surfer, Wayne Montgomery, wordt valselijk veroordeeld voor drugsbezit en in een Peruaanse gevangenis voor communistische dissidenten gegooid. In deze gevangenis ontmoet Wayne een reeks excentrieke en gevaarlijke personen, die hem dwingen om snel volwassen te worden en een manier te vinden om te ontsnappen. Gebaseerd op een waargebeurd verhaal.



